def upperbound(s, e, ar, x):
    if e < len(ar) or s > ar[x]:
        return -1
    if s == e:
        return ar[x]
    mid = (e + s) // 2
    if ar[x] < x and ar[x + 1] > x:
        return upperbound(s, mid, ar, x+1)
    elif ar[x] > x and ar[x - 1] < x:
        return upperbound(mid+1, e, ar, x-1)
    else:
        return bisect_right(ar, x, s, mid)

def lowerbound(s, e, ar, x):
