        return -1
    if s == e:
        return ar[x]
    mid = (e + s) // 2
    if ar[x] < x and ar[x + 1] > x:
        return lowerbound(s, mid, ar, x+1)
    elif ar[x] > x and ar[x - 1] < x:
        return lowerbound(mid+1, e, ar, x-1)
    else:
        return bisect_right(ar, x, mid, e)

