def dot(v1, v2):
    return v1[0]*v2[0] + v1[1]*v2[1]


def cross(v1, v2):
    return v1[0]*v2[1] - v1[1]*v2[0]


def angle(v1, v2):
    return math.acos(dot(v1, v2) / (math.sqrt(dot(v1, v1)) *
                                 math.sqrt(dot(v2, v2))))

def is_clockwise(v1, v2):
    return angle(v1, v2) > math.pi / 2


def is_counter_clockwise(v1, v2):
    return angle(v1, v2) < math.pi / 2


def dist(v1, v2):
    return math.sqrt((v1[0]-v2[0])**2 + (v1[1]-v2[1])**2)


