class Solution:
    def majorityElement(self, nums):
        """
        :type nums: List[int]
        :rtype: List[int]
        """
        count = {}
        for num in nums:
            if num in count:
                count[num] += 1
            else:
                count[num] = 1
        # print(count)
        max_count = 0
        max_element = 0
        for key, value in count.items():
            if value > max_count:
                max_count = value
                max_element = key
            elif value == max_count:
                max_element = key
        return [max_element]

