def modinv(n, p):
    return pow(n, p-2, p)

def ncr(n, r, p):
    if n < r:
        return 0
    if r == 1:
        return 1
    fac = [1, 1]
    for i in range(2, n+1):
        fac.append((fac[i-1]*i) % p)
    return (fac[n]*modinv(fac[r], p)) % p

