class Solution:
    def merge(intervals):
        """
        :type intervals: List[List[int]]
        :type newInterval: List[int]
        :rtype: List[List[int]]
        """
        if not intervals:
            return [newInterval]

        intervals.sort(key=lambda x: x[0])
        new = [newInterval]
        for interval in intervals:
            if new[-1][1] < interval[0]:
                new.append(interval)
            else:
                new[-1][1] = max(new[-1][1], interval[1])
        return new

