from fractions import Fraction


def color_of_offspring(female, male):
    black = {'B': 1, 'b': 0}
    red = {'O': 1, 'd': 0}
    dilution = {'D': 1, '-': 0}

    female_prob = Fraction(1, 2) * black[male] + Fraction(1, 4) * red[male] + Fraction(1, 2) * dilution[male]
    male_prob = Fraction(1, 2) * black[female] + Fraction(1, 4) * red[female] + Fraction(1, 2) * dilution[female]

    offspring_prob = (female_prob * male_prob)

    return sorted(offspring_prob.as_integer_ratio(), key=offspring_prob.as_integer_ratio().rfind('-'), reverse=True)

