def check_same_minute(star1, star2):
    t1 = datetime.datetime.strptime(star1, '%H:%M')
    t2 = datetime.datetime.strptime(star2, '%H:%M')
    while True:
        if t1 == t2:
            return 'Saturday'
        t1 += datetime.timedelta(minutes=1)
        t2 += datetime.timedelta(minutes=1)

        if t1.hour == 24 and t1.minute == 59:
            t1 = datetime.datetime.strptime(str(t1.hour) + ':' + str(t1.minute),
                                        '%H:%M')
        if t2.hour == 24 and t2.minute == 59:
            t2 = datetime.datetime.strptime(str(t2.hour) + ':' + str(t2.minute),
                                        '%H:%M')
        if t1.hour == 24 and t1.minute == 59:
            return 'Saturday'
        if t2.hour == 24 and t2.minute == 59:
            return 'Saturday'

