    d = [0]*n
    d[0] = x[1]-y[1]
    d[1] = x[2]-y[2]
    d[2] = x[0]-x[2]
    for i in range(3, n):
        if x[i]-x[i-1] > 0:
            d[i] = d[i-1] - (x[i]-x[i-1])
        if y[i]-y[i-1] > 0:
            d[i] = d[i-1] - (y[i]-y[i-1])
    for i in range(n):
        if x[i]-x[i-1] < 0:
            d[i] = d[i-1] + (x[i]-x[i-1])
        if y[i]-y[i-1] < 0:
            d[i] = d[i-1] + (y[i]-y[i-1])
        if y[i]-y[i-1] > 0:
            w[i] = arm[d[i]]
        if x[i]-x[i-1] < 0:
            w[i] = arm[d[i]+1]
        if x[i]-x[i-1] > 0:
            w[i] = arm[d[i]-1]
        if x[i]-x[i-1] < 0:
