import math


def is_prime(x):
    if x == 1:
        return False
    for i in range(2, int(math.sqrt(x))+1):
        if x % i == 0:
            return False
    return True


def get_prime_factors(x):
    prime_factors = []
    for i in range(2, int(math.sqrt(x))+1):
        if x % i == 0 and is_prime(i):
            prime_factors.append(i)
            while x % i == 0:
                x //= i
    if x != 1:
        prime_factors.append(x)
    return prime_factors


