def distance(x1, y1, x2, y2):
    return math.sqrt((x2-x1)**2 + (y2-y1)**2)


def pan(x1, y1, x2, y2):
    return distance(x1, y1, x2, y2)


def zoom(x1, y1, x2, y2):
    return distance(x1, y1, x2, y2) / 2


def rotate(x1, y1, x2, y2):
    dx = x2 - x1
    dy = y2 - y1
    angle = math.atan2(dy, dx)
    return angle


def classify_gesture(x1, y1, x2, y2):
    pan_distance = pan(x1, y1, x2, y2)
    zoom_distance = zoom(x1, y1, x2, y2)
    rotation_distance = rotate(x1, y1, x2, y2)
    if pan_distance > zoom_distance:
        return 'pan', pan_distance, zoom_distance
    elif pan_distance < zoom_distance:
        return 'zoom', zoom_distance, pan_distance
    else:
        return 'rotate', rotation_distance, zoom_distance


