def word_ladder(start, end):
    dict = set()
    for word in start.split():
        dict.add(word)
    if end not in dict:
        return 0, -1
    steps = 0
    word = end
    while word != start:
        dict.add(word)
        for i in range(len(word)):
            new_word = word[:i] + chr(ord(word[i]) + 1) + word[i+1:]
            if new_word in dict:
                word = new_word
                break
        steps += 1
    return word, steps

