import math


def is_prime(x):
    if x == 2:
        return True
    if x < 2 or x % 2 == 0:
        return False
    for i in range(3, int(math.sqrt(x))+1, 2):
        if x % i == 0:
            return False
    return True


def solve(n):
    if n == 2:
        return 2
    for i in range(3, int(math.sqrt(n))+1):
        if is_prime(i):
            if is_prime(n//i):
                return i
    return 2


